import React from 'react'
import CheckboxToDo from './CheckboxToDo'

function MainContent(){
  return(
    <div>
    <CheckboxToDo text="Test1" />
    <CheckboxToDo text="Test2" />
    <CheckboxToDo text="Test3" />
    <CheckboxToDo text="Test4" />
    </div>
  )
}


export default MainContent;
